import { type } from "os";
import React from "react";
import CardResturant from "../../../CardResturant/CardResturant";
import IDishCard from "../../../Types/Interfaces/IDishCard";
import IRestaurantCard from "../../../Types/Interfaces/IRestaurantCard";
import "./PopularRestaurant.css";
interface Interface {
  title: string;
  interfaceCard: IRestaurantCard | IDishCard;
  isToAllButton: boolean;
  buttonText: string;
  buttonFunc: Function;
}
const PopularRestaurant: React.FC<Interface> = (props) => {
  return (
    <div className="rowAndTitle">
      <h2>{props.headline}</h2>
      <div className="row">
        <CardResturant
          name="Claro"
          img="/imges/clarodesktop.png"
          chef="Ran Shmueli"
          rating={4}
        />
        <CardResturant
          name="Claro"
          img="/imges/clarodesktop.png"
          chef="Ran Shmueli"
          rating={4}
        />
        <CardResturant
          name="Claro"
          img="/imges/clarodesktop.png"
          chef="Ran Shmueli"
          rating={4}
        />
      </div>
      <div className="textButton">
        <span>All restaurants</span>
        <img src="/imges/icons/errow.svg" alt="errow" />
      </div>
    </div>
  );
};

export default PopularRestaurant;
